Production year: 2014 
Country: United States 
Genre: Feature 
Duration: 2:07:44 
Language: English 

Director: Jacky St. James 
Studio: New Sensations 
Starring: Maddy O'Reilly, India Summer, Jessa Rhodes, Natalia Starr, with Xander Corvus, Steven St. Croix, Johnny Castle. 

Description: After growing up in a conservative home, a sexually repressed, Anna Lee (Maddy O'Reilly) seeks help in the most unlikely of places - an unconventional therapy practice called the Variel House. Known for taking a very hands-on approach to treatment, the Variel House pushes patients to their sexual limits through a variety of exercises geared at helping them confront their fears. It is during these exercises that Anna Lee is paired up with Emmett (Xander Corvus), a patient battling his own demons, and the two forge an unlikely friendship. Together they share their most intimate secrets and hidden desires while navigating an intensely provocative road towards sexual freedom. But when their erotic journey proves too challenging for Emmett to handle, Anna is left wondering whether true liberation can only be found on one's own.
